import React from 'react';
import '../css/Realisations.css';
import Photo1 from '../assets/images/hello.png';
import Photo2 from '../assets/images/competence.png';
import Photo3 from '../assets/images/hello.png';
import { 
    CCarousel,
    CCarouselItem,
    CImage,
    CCarouselCaption,
} from '@coreui/react'

const Realisations = () => {

  return (
    <div className="real_container">
        <div className="real_item">
            <CCarousel className='carousel_container' controls indicators>
                <CCarouselItem className='carousel_item'>
                    <CImage className="d-block w-10" src={Photo1} alt="slide 1" />
                    <CCarouselCaption className="d-none d-md-block">
                    <h5>First slide label</h5>
                    <p>Some representative placeholder content for the first slide.</p>
                    </CCarouselCaption>
                </CCarouselItem>
                <CCarouselItem>
                    <CImage className="d-block w-10" src={Photo1} alt="slide 2" />
                    <CCarouselCaption className="d-none d-md-block">
                    <h5>Second slide label</h5>
                    <p>Some representative placeholder content for the first slide.</p>
                    </CCarouselCaption>
                </CCarouselItem>
                <CCarouselItem>
                    <CImage className="d-block w-10" src={Photo1} alt="slide 3" />
                    <CCarouselCaption className="d-none d-md-block">
                    <h5>Third slide label</h5>
                    <p>Some representative placeholder content for the first slide.</p>
                    </CCarouselCaption>
                </CCarouselItem>
            </CCarousel>
        </div>    
    </div>
  );
};

export default Realisations;
